-- ----------------------------
-- Table structure for dcd_activity
-- ----------------------------
DROP TABLE IF EXISTS `dcd_activity`;
CREATE TABLE `dcd_activity` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) DEFAULT NULL COMMENT '活动名称',
  `icon` varchar(255) DEFAULT NULL COMMENT '活动封面URL',
  `introduction` varchar(255) DEFAULT NULL COMMENT '活动简介',
  `groupId` int(20) DEFAULT NULL COMMENT '关联群组ID',
  `account` varchar(50) NOT NULL COMMENT '发布者账号',
  `fellowship` int(11) NOT NULL COMMENT '所属团契编号',
  `activityType` int(1) DEFAULT '1' COMMENT '活动类型 1普通活动  2打卡活动',
  `isTop` bit(1) DEFAULT b'0' COMMENT '是否置顶',
  `status` bit(1) DEFAULT b'1' COMMENT '1有效0失效',
  `expireTime` datetime DEFAULT NULL COMMENT '过期时间',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`account`,`fellowship`) USING BTREE,
  KEY `account` (`account`),
  KEY `fellowship` (`fellowship`),
  KEY `id` (`id`),
  KEY `groupId` (`groupId`),
  CONSTRAINT `dcd_activity_ibfk_2` FOREIGN KEY (`account`) REFERENCES `dcd_user` (`account`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_activity_ibfk_3` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

