-- ----------------------------
-- Table structure for dcd_advertisement
-- ----------------------------
DROP TABLE IF EXISTS `dcd_advertisement`;
CREATE TABLE `dcd_advertisement` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(255) DEFAULT NULL COMMENT '广告标题',
  `subtitle` varchar(255) DEFAULT NULL COMMENT '广告副标题',
  `content` text COMMENT '广告内容',
  `advertisementUrl` varchar(255) DEFAULT NULL COMMENT 'AD_URL',
  `targetUrl` varchar(255) DEFAULT NULL COMMENT '广告跳转目标URL',
  `account` varchar(50) NOT NULL COMMENT '发布者账号',
  `fellowship` int(11) NOT NULL COMMENT '所属团契编号',
  `type` int(2) NOT NULL COMMENT '广告类型：1.启动广告 2.弹框广告',
  `duration` float(5,0) DEFAULT NULL COMMENT '展示时长',
  `isTop` bit(1) DEFAULT b'0' COMMENT '是否置顶',
  `status` bit(1) DEFAULT b'1' COMMENT '1有效0失效',
  `expireTime` datetime DEFAULT NULL COMMENT '过期时间',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`account`,`fellowship`) USING BTREE,
  KEY `fellowship` (`fellowship`),
  KEY `account` (`account`),
  CONSTRAINT `dcd_advertisement_ibfk_1` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_advertisement_ibfk_2` FOREIGN KEY (`account`) REFERENCES `dcd_user` (`account`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

