-- ----------------------------
-- Table structure for dcd_article
-- ----------------------------
DROP TABLE IF EXISTS `dcd_article`;
CREATE TABLE `dcd_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID主键',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `subtitle` varchar(255) DEFAULT NULL COMMENT '副标题',
  `author` varchar(100) DEFAULT NULL COMMENT '作者',
  `account` varchar(50) NOT NULL COMMENT '发布者账号',
  `icon` varchar(500) DEFAULT NULL COMMENT '主图',
  `content` text COMMENT '文章内容',
  `articleUrl` varchar(255) DEFAULT NULL COMMENT '文章URL',
  `status` bit(1) DEFAULT b'1' COMMENT '文章状态 0不可用 1可用',
  `isTop` bit(1) DEFAULT b'0' COMMENT '是否置顶',
  `articleType` int(1) DEFAULT '1' COMMENT '文章类型 ：1普通 2转载',
  `fellowship` int(11) NOT NULL COMMENT '所属团契编号',
  `expireTime` datetime DEFAULT NULL COMMENT '过期时间',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`account`,`fellowship`) USING BTREE,
  KEY `账号_关联_用户表_account` (`account`),
  KEY `团契_关联_团契表_id` (`fellowship`),
  KEY `id` (`id`),
  CONSTRAINT `账号_关联_用户表_account` FOREIGN KEY (`account`) REFERENCES `dcd_user` (`account`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `团契_关联_团契表_id` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of dcd_article
-- ----------------------------
BEGIN;
INSERT INTO `dcd_article` VALUES (3, '展翅上腾', '拦阻生命成长、展翅上腾的原因是什么?', '生命季刊', '7793477', 'https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1579894560586&di=cdf1cb43c2fa0f1876022f881e1402f1&imgtype=0&src=http%3A%2F%2Fdimg05.c-ctrip.com%2Fimages%2Ffd%2Ftg%2Fg3%2FM03%2F91%2FDC%2FCggYG1bQN6-AVTSJAABucYRCLgQ766.jpg', '每当我看见天上一群群的飞鸟，从我头顶掠过时，都会被这群快乐的天路客所吸引。我总喜欢停下来观看它们展翅上腾、在天空中自由快乐飞翔的景象。能够如此无拘无束地翱翔天际，岂不是一件快乐的事吗？\n \n其实我们也是一群群的天路客。我们伟大的救主耶稣基督道成肉身来到世界上，亲自将我们从罪恶势力中救赎出来，赐给我们属天的新生命。这是一个充满喜乐、平安的新生命，为什么呢？因为属天的人活在地上，他内心能够超越今生的物质世界，活出属于永恒的丰盛生命。\n \n基督徒在地上的生活常常充满许多障碍，如果我们可以突破那些拦阻我们活出属天生命的一切障碍，我们就可以在属灵的领域中自由翱翔，饱尝属天的福乐！那今天拦阻着我们、使我们失去属天的喜乐、甚至不能超越这个世界的，都是些什么障碍呢？\n \n我们所在的处境、生活中遇到的种种难处、身边的人和事等等，这些都有可能成为外在的阻碍。但是真正最深的根源，还是我们内在的生命的问题，就是我们老亚当的生命还在掌权作王。\n \n加拉太书5:16-17 “我说，你们当顺着圣灵而行，就不放纵肉体的情欲了。因为情欲和圣灵相争，圣灵和情欲相争，这两个是彼此相敌，使你们不能做所愿意做的。”\n \n什么是情欲的事呢？\n \n加拉太书5:19-21 “情欲的事都是显而易见的，就如奸淫、污秽、邪荡、拜偶像、邪术、仇恨、争竞、忌恨、恼怒、结党、纷争、异端、嫉妒、醉酒、荒宴等类。我从前告诉你们，现在又告诉你们，行这样事的人必不能承受神的国。”\n \n许多基督徒虽然已经承认主名，但我们的旧生命却仍然占上风，老亚当的生命仍然作王，这些就是影响我们属灵的生命不能成长的根本原因所在。\n \n除了上面加拉太书5:19至21所提到的那些情欲的事，我们还有许多其它败坏之处，比如有些人行事为人见风使舵、处事不公平、不公义、凭外表待人、喜富厌贫、与世俗为友等等。每一样不好的心思意念都像一线蛛丝，罪恶的意念越多，蛛丝织得越密，最后织出一张千丝万缕、牢固细密的蛛网，将我们牢牢地罩住。这蛛网不除，猎物又怎能得着释放呢！不要说翱翔了，就是起飞都不能实现，最后就只能沦为撒但攻击和欺负的对象了。这样的基督徒在外表上可能还是很热心服事，在教会做很多事工，但这些其实只是肉体上的事奉，没有圣灵的同在，只不过是草木禾秸的工程罢了。\n \n希伯来书12:1 “我们既有这许多的见证人，如同云彩围着我们，就当放下各样的重担，脱去容易缠累我们的罪，存心忍耐，奔那摆在我们前头的路程。”\n \n就是这些缠累我们的罪，在我们的生命中成为重担，这些都是不蒙神喜悦的部分，就是老亚当仍在我们生命中作王的那部分。\n \n 一个外表光鲜亮丽的杯子很吸引人，但当人拿起来想装水喝的时候，才发现里面很肮脏，没有人会用这个杯。同样，神看人是看其内心，神要看的是人里面有没有基督的生命。\n \n马太福音5:8 “淸心的人有福了，因为他们必得见神”。清心的人指的是那些内心没有诡诈与虚假的人，他们对人处事力求公平、公正、公义，对神则以心灵诚实来敬拜，这样的人必得见神。神出于自己圣洁的属性而喜悦人内心的圣洁，彼得前书1:16“你们要圣洁，因为我是圣洁的”。清心的人是最享受与神同在的人，这种人在世上活得最喜乐，因为他们已经脱去那容易缠累他们的罪，放下了罪的重担，他们就能够成为在属灵的领域中自由翱翔的天路客！\n \n然而若是靠着我们自己的努力，我们断然无法做到。人不可能留在老亚当的生命中，却想要成为清心的人、活出圣洁的生命。活出新生命必须要靠着从圣灵而来的能力，将我们老亚当的生命与基督同钉死在十架上，将一切的邪情私欲治死，让旧人里面的性情一一被对付被治死，新人就活出来了！我们自己毫无能力，然而我们凭着一颗真诚悔改，饥渴慕义的心，不断地依靠圣灵的力量，我们属天的生命，也必一天天地成长壮大！\n \n希伯来书12:2“仰望为我们信心创始成终的耶稣。祂因那摆在祂前面的喜乐，就轻看羞辱，忍受了十字架的苦难，便坐在神宝座的右边。”\n \n同样，今天我们这些蒙主耶稣十字架所拯救的儿女们，让我们一起仰望我们亲爱的救主耶稣基督，轻看世上一切的苦难与羞辱，因为一切苦难都是神对我们的造就；一切羞辱都是主耶稣曾经亲尝过的滋味。主耶稣要赐给我们的生命，是与祂亲密无间、与祂自己完全合一的生命！\n \n求主的灵来光照我们，赐给我们敏锐的属灵触觉，当我们面对任何事情的时候，使我们能分辨哪些是出自肉体的意念，哪些是出自圣灵的提醒。也求主赐给我们属灵的智慧和能力，使我们胜过肉体的邪情私欲。再赐我们谦卑温柔的心去领受一切真理的教导，让主真正坐在我们生命的宝座上，让主在我们的生命中掌权作王。只有这样，圣灵的能力才能在我们生命中顺畅无阻地运行；我们才能活出属神儿女应有的自由、喜乐、丰盛的属灵生命；才能为主做盐与发光，在这弯曲悖谬、黑暗败坏的世代，成为主的美好见证！哈利路亚！', NULL, b'1', b'0', 1, 1, NULL, '2019-12-06 11:40:59', '2019-12-06 11:40:55');
INSERT INTO `dcd_article` VALUES (4, '牧者寄语', '2020新年', '仝大哥', '7793477', 'http://image.daocaodui.top/image_6.jpg', '亲爱的弟兄姊妹平安，我们即将迎来新的一年，一个新的季节。可是在这年终的最后时节，我们却经历了让人非常难过担心的事，看到许多着急，难过，恐惧，愤怒的脸庞，这个时候我们才真正感觉到外面的承诺，安慰是何等的软弱无力。主耶稣才是真正的安慰医治者，主耶稣才是指示我们走正确道路的那一位，他就是道路。即将来临的这一年将比过去的一年更重要。因为我们看到神提醒我们机会并不总是太多，他要我们在新的一年更多认识他，更深住在他的里面。也要更多在祷告中记念在苦难疾病中的同胞，堵住破口，求主医治这九百六十万的土地。愿神赐福大家，且赐给大家一个平安喜乐的新年在主里面。', NULL, b'1', b'1', 1, 1, NULL, '2020-01-25 00:50:25', '2020-01-25 00:50:19');
INSERT INTO `dcd_article` VALUES (6, '哈哈-哆啦A梦', '你的童年机器猫去哪了', 'duolaam', '7793477', 'http://file.daocaodui.top/1577273419067_UNADJUSTEDNONRAW_thumb_437.jpg', '漫画叙述了一只来自22世纪的猫型机器人——哆啦A梦，受主人野比世修的托付，回到20世纪，借助从四维口袋里拿出来的各种未来道具，来帮助世修的高祖父——小学生野比大雄化解身边的种种困难问题，以及生活中和身边的小伙伴们发生的轻松幽默搞笑感人的故事。 作品自1970年1月开始在《小学1-4年级生》杂志中开始连载，并且大受小学生欢迎。《哆啦A梦》系列的篇幅浩繁，由原作者亲自执笔的短篇漫画共1345回（分为45卷单行本），大长篇漫画16回，《哆啦A梦Plus》6卷，在藤本弘去世后，又由其弟子创作了大量漫画，至今仍有新作品在不断推出。', 'https://www.baidu.com/', b'1', b'0', 1, 1, NULL, NULL, NULL);
INSERT INTO `dcd_article` VALUES (26, '一起玩', 'Play Games', '', '7793477', 'http://file.daocaodui.top/C270BC55-FAEE-4373-A16C-DCCF0B4D3F84_1_105_c.jpeg', '你走了，我来了\n撒些小果子来纪念\n那是纯真的年代\n你睡着了，我却时常醒来\n落笔写满你的名字\n那是我们的友谊', '', b'1', b'0', 1, 1, NULL, NULL, '2019-12-28 15:10:06');
COMMIT;

