-- ----------------------------
-- Table structure for dcd_filelog
-- ----------------------------
DROP TABLE IF EXISTS `dcd_filelog`;
CREATE TABLE `dcd_filelog` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `fileUrl` varchar(255) DEFAULT NULL COMMENT '文件URL',
