-- ----------------------------
-- Table structure for dcd_group
-- ----------------------------
DROP TABLE IF EXISTS `dcd_group`;
CREATE TABLE `dcd_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `groupId` int(20) NOT NULL COMMENT '群组ID',
  `groupIcon` varchar(255) DEFAULT NULL COMMENT '组群头像',
  `groupName` varchar(125) DEFAULT NULL COMMENT '群组名称',
  `creator` varchar(255) NOT NULL COMMENT '创建人',
  `introduction` varchar(255) DEFAULT NULL COMMENT '群简介',
  `isBan` bit(1) DEFAULT b'0' COMMENT '是否禁言',
  `isVerify` bit(1) DEFAULT b'0' COMMENT '是否需要验证',
  `status` bit(1) DEFAULT b'1' COMMENT '群组状态 0不可用 1可用',
  `groupType` int(1) DEFAULT '1' COMMENT '群组类型 1公开群  2私人群"',
  `fellowship` int(11) NOT NULL COMMENT '所属团契编号',
  `expireTime` datetime DEFAULT NULL COMMENT '过期时间',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`fellowship`,`groupId`,`creator`) USING BTREE,
  KEY `groupId` (`groupId`),
  KEY `creator` (`creator`),
  KEY `fellowship` (`fellowship`),
  CONSTRAINT `dcd_group_ibfk_1` FOREIGN KEY (`creator`) REFERENCES `dcd_user` (`account`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_group_ibfk_2` FOREIGN KEY (`groupId`) REFERENCES `dcd_activity` (`groupId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_group_ibfk_3` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8;

