-- ----------------------------
-- Table structure for dcd_recommend
-- ----------------------------
DROP TABLE IF EXISTS `dcd_recommend`;
CREATE TABLE `dcd_recommend` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(255) DEFAULT NULL COMMENT '标题',
  `content` text COMMENT '推荐理由',
  `iconUrl` varchar(255) DEFAULT NULL COMMENT '推荐物品图片',
  `targetUrl` varchar(255) DEFAULT NULL COMMENT '跳转目标URL',
  `account` varchar(50) NOT NULL COMMENT '发布者账号',
  `fellowship` int(11) NOT NULL COMMENT '所属团契编号',
  `isTop` bit(1) DEFAULT b'0' COMMENT '是否置顶',
  `status` bit(1) DEFAULT b'1' COMMENT '1有效0失效',
  `expireTime` datetime DEFAULT NULL COMMENT '过期时间',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`account`,`fellowship`) USING BTREE,
  KEY `fellowship` (`fellowship`),
  KEY `account` (`account`),
  CONSTRAINT `dcd_recommend_ibfk_1` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_recommend_ibfk_2` FOREIGN KEY (`account`) REFERENCES `dcd_user` (`account`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of dcd_recommend
-- ----------------------------
BEGIN;
INSERT INTO `dcd_recommend` VALUES (6, '《殉道史》', '本书记述了从1世纪到16世纪西方历史上基*徒为信仰而殉难的事迹，其中着重叙述了从14世纪到作者所在的生活时代，即从英国宗*改革的先锋威克里夫时代到玛丽一世的整个统治期间，英国的更正教信徒或亲更正教人士所受的各种患难与逼迫。\n在世界历史上，教会史学家的书绝少能对历史产生影响，唯约翰福克斯的《殉道史》是个例外。作为一本家喻户晓的书，在成千上万户家庭中，它曾与《天路历程》和《S经》摆放在一起，即使到了今天，它仍适应这个时代的需要，在传扬福音和见证更正教真理方面发挥着它卓越的贡献。', 'https://img3.doubanio.com/view/subject/l/public/s4590830.jpg', 'https://book.douban.com/subject/5423786/', '7793477', 1, b'0', b'1', NULL, NULL, '2020-01-07 16:22:42');
INSERT INTO `dcd_recommend` VALUES (7, '《祈祷出来的能力》', '韦斯利约翰每天用两个小时祷告，从早上四时开始。他的祷告生活使我们感到惭愧。', 'https://img1.doubanio.com/view/subject/l/public/s2982259.jpg', 'https://book.douban.com/subject/3021808/', '17693111', 1, b'0', b'1', NULL, NULL, '2020-01-07 12:22:42');
INSERT INTO `dcd_recommend` VALUES (8, '《作门徒的代价》', '朋霍费尔的生与死就属于基督教的殉道史，或者如尼布尔所说的，“属于现代的使徒行传”。他不屈不挠的战斗已经成为灵性重于物质的生动象征。他的行为已经表明，仁爱的和真正有人性的人的灵性，必定战胜邪恶，这种邪恶不能攻破负责的灵性自由的最后堡垒。“精神的生命并不逃避死亡和摆脱毁灭：相反，它承担死亡并在死亡中得到保全。它只有在完全的毁灭中才能实现其真理。”', 'https://img3.doubanio.com/view/subject/l/public/s3102130.jpg', 'https://book.douban.com/subject/1658437/', '7793477', 1, b'0', b'1', NULL, NULL, '2020-01-07 14:58:36');
INSERT INTO `dcd_recommend` VALUES (10, '《一生的呼召》', '此生要做什么，以及为何而做？这个困扰葛尼斯多年的问题，正是作者创作的本源。了解呼召的真义，使作者从错误的教导中解脱，走上神为他安排的道路。', 'https://img9.doubanio.com/view/subject/l/public/s6139974.jpg', 'https://book.douban.com/subject/6310967/', '7793477', 1, b'0', b'1', NULL, NULL, '2020-01-07 12:22:42');
INSERT INTO `dcd_recommend` VALUES (11, '《上帝的情书》', '《上帝的情书》不是辩道或护教作品，也不是对文本进行文学或考古批评的著作，而是自我探索的作品。当我们带着各类疑问进入旧约世界，许多问题都将变成我们的自我追问。在一次次的探索和追问中，我们不断理解旧约并认识自己，也不断惊叹于上帝的深情和智慧。', 'https://img1.doubanio.com/view/subject/l/public/s11276418.jpg', 'https://book.douban.com/subject/10601559/', '7793477', 1, b'0', b'1', NULL, NULL, '2020-01-07 12:22:42');
COMMIT;

