  `score` float(7,0) DEFAULT '0' COMMENT '积分',
  `gender` varchar(10) DEFAULT NULL COMMENT '性别',
  `phone` varchar(15) DEFAULT NULL COMMENT '手机号',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `token` varchar(255) DEFAULT NULL COMMENT '登录令牌',
  `imToken` varchar(255) DEFAULT NULL COMMENT 'IM令牌',
  `introduction` varchar(255) DEFAULT NULL COMMENT '简介',
  `email` varchar(70) DEFAULT NULL COMMENT '邮箱',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `fellowship` int(4) NOT NULL COMMENT '团契ID',
  `role` int(4) NOT NULL DEFAULT '1' COMMENT '角色ID',
  `qqOpenid` varchar(100) DEFAULT NULL COMMENT 'QQ',
  `wcOpenid` varchar(100) DEFAULT NULL COMMENT '微信',
  `appleUserId` varchar(100) DEFAULT NULL COMMENT 'Apple登录',
  `status` bit(1) DEFAULT b'1' COMMENT '1有效0失效',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`fellowship`,`role`) USING BTREE,
  KEY `account` (`account`),
  KEY `id` (`id`),
  KEY `fellowship` (`fellowship`),
  KEY `role` (`role`),
  CONSTRAINT `dcd_user_ibfk_1` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_user_ibfk_2` FOREIGN KEY (`role`) REFERENCES `dcd_role` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8;

