-- Table structure for dcd_weekbible
-- ----------------------------
DROP TABLE IF EXISTS `dcd_weekbible`;
CREATE TABLE `dcd_weekbible` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `bible` text COMMENT '经文',
  `iconUrl` varchar(255) DEFAULT NULL COMMENT '封面图URL',
  `targetUrl` varchar(255) DEFAULT NULL COMMENT '跳转目标URL',
  `account` varchar(50) NOT NULL COMMENT '发布者账号',
  `fellowship` int(11) NOT NULL COMMENT '所属团契编号',
  `weekOfYear` int(2) DEFAULT NULL COMMENT '周数',
  `status` bit(1) DEFAULT b'1' COMMENT '1有效0失效',
  `expireTime` datetime DEFAULT NULL COMMENT '过期时间',
  `gmtModify` datetime DEFAULT NULL COMMENT '修改时间',
  `gmtCreate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`,`account`,`fellowship`) USING BTREE,
  KEY `fellowship` (`fellowship`),
  KEY `account` (`account`),
  CONSTRAINT `dcd_weekbible_ibfk_1` FOREIGN KEY (`fellowship`) REFERENCES `dcd_fellowship` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `dcd_weekbible_ibfk_2` FOREIGN KEY (`account`) REFERENCES `dcd_user` (`account`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

